import { func } from "prop-types";
import "../index.css";
import "../styles/TargetList.css";
function TargetList({ x, y, list }) {
  function handleTest() {
    console.log("wdw");
  }
  return (
    <div
      className="targetList"
      style={{
        top: `${y}px`,
        left: `${x}px`,
      }}
    >
      {list.map((target, index) => (
        <div key={index} className="listBox" onClick={handleTest}>
          <img src={target.image} className="listBoxImg" alt=""></img>
          <p>{target.name}</p>
        </div>
      ))}
    </div>
  );
}

export default TargetList;
